import React from 'react';
import NavBar from '../components/header/NavBar';
import Footer from '../components/Footer';
import ContactForm from '../components/ContactForm';

function Contact() {
  return (
    <div>
      <NavBar />
      <ContactForm />
      <Footer />
    </div>
  );
}

export default Contact;
